import socketClient  from "socket.io-client";
const SERVER = "http://127.0.0.1:8080";
function App() {
	const [test,setTest] = useState('nothing yet')
    var socket = socketClient (SERVER);
	socket.on('connection', () => {console.log("connected with backend")})
	socket.on('test_connection', (response) => {setTest(response)});
    return (
        <div classname="App">
			{test}
		</div>
	)
}

export default App;
